/*
  This file is a componet for the landing page section of the portfolio site.
    (home page that user lands on)
  It contains all the code for that specific section of the site!!

*/
import React, {
	Component
} from 'react';

import {
	Link,
	animateScroll as scroll
} from 'react-scroll';

import {
	Grid,
	Cell
} from 'react-mdl';


class Landing extends Component {

	scrollToBottom = () => {
		scroll.scrollToBottom();
	}

	render() {
		return (
			<div className = "landing-page" style={{ width: '100%' }}>
				<Grid className="landing-grid" >
					<Cell col={12} row={12}>
						<div>

							<img src={require('../Media/ProfilePic.jpg')}
								alt="ProfilePic"
								className="ProfilePic"
								onClick={this.scrollToBottom}
							/>
						</div>
						<div className="technical-skills" >
							<h1> Technical Skills </h1>
							<hr />
							<div className="ts-images">

								<div className="react-img">
									<img src={require('../Media/react-logo.png')}
										alt="ts-react"
										className="ts-react"
									/>

								</div>

								<div className="css-img" >
									<img src={require('../Media/css-logo.png')}
										alt="ts-css"
										className="ts-css"
									/>
								</div>

							</div>
						</div>

						<div className="banner-text" >

							<h1> Programmmer </h1>
							<hr />
							<p> C# | C++ | CSS | HTML | JavaScript | Python </p>
								<i className="fa fw-fa fa-github"></i>
							<div className="social-icons" >
							</div>


						</div>
						<div className="banner-text" >




</div>
					</Cell>
				</Grid>
			</div>
		)
	}
}

export default Landing;
